import React, { Component } from 'react';
import '../styles/index.css';


const img = './assets/images/reactlogo.svg';

class Footer extends Component {
    render() {
        return (
            <footer className='footer'>
                <div className='bottom'>
                    <a href='https://github.com/a' target='_blank' rel='noopener noreferrer'>Ariana Melis</a></div>

                    <a href='https://github.com/arianamelis' target='_blank' rel='noopener noreferrer'>Portfolio</a>

            </footer>
        );
    }
}

export default Footer;
